	add("assignat", "{\"term\":\"assignat\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027assignat\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A banknote used during the French Revolution, on the security of state land\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"They would not give a dog\u0027s ear of their most rumpled and ragged Scotch paper for twenty of your fairest \u0027\u0027assignats\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1932\u0027\u0027, \u0027Talleyrand\u0027, Folio Society 2010, p. 25\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He was in favour of a national bank; he was strongly opposed to the reckless issue of \u0027\u0027\u0027assignats\u0027\u0027\u0027 and spoke against it in the Assembly\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027The Great Nation\u0027, Penguin 2003, p. 508\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The continuing depreciation of the \u0027\u0027\u0027assignat\u0027\u0027\u0027 was worsening problems: in November and December, the currency\u0027s cash return dipped below 1 per cent of its face value, bringing a comic aspect to many exchanges and inducing street beggars to decline alms in paper form\", \"priority\":6}]}, \"synonyms\":{}}");

	add("assignation", "{\"term\":\"assignation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027assignacion\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An appointment for a meeting, generally of a romantic or sexual nature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Alexander Pop\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"While nymphs take treats, or \u0027\u0027assignations\u0027\u0027 give\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1749\u0027\u0027 \u0027As soon as Mr. Barville saw me, he got up, with a visible air of pleasure and surprize, and saluting me, asked Mrs. Cole if it was possible that so fine and delicate a creature would voluntarily submit to such sufferings and rigours as were the subject of his \u0027\u0027assignation\u0027\u0027. — John Cleland, \u0027[http://etext.virginia.edu/etcbin/ot2www-pubeng?specfile\u003d/texts/english/modeng/publicsearch/modengpub.o2w\u0026amp;act\u003dtext\u0026amp;offset\u003d167923312\u0026amp;textreg\u003d1\u0026amp;query\u003dassignation\u0026amp;id\u003dCleMemo Memoirs of Fanny Hill\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The act of assigning or allotting; apportionment\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Hollan\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"This order being taken in the senate, as touching the appointment and \u0027\u0027assignation\u0027\u0027 of those provinces\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A make making over by transfer of title; assignment\", \"priority\":8}]}, \"synonyms\":{}}");

	add("assignment", "{\"term\":\"assignment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Old french (842-ca. 1400) \u0027assignement\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of assigning; the allocation of a job or a set of tasks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"This flow chart represents the \u0027\u0027assignment\u0027\u0027 of tasks in our committee\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The categorization of something as belonging to a specific category\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"We should not condone the \u0027\u0027assignment\u0027\u0027 of asylum seekers to that of people smugglers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An assigned task\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027assignment\u0027\u0027 the department gave him proved to be quite challenging\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A position to which someone is assigned\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Unbeknownst to Mr Smith, his new \u0027\u0027assignment\u0027\u0027 was in fact a demotion\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A task given to students, such as homework or coursework\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Mrs Smith gave out our \u0027\u0027assignments\u0027\u0027, and said we had to finish them by Monday\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A transfer of something from one person to another, especially property, or a claim or right\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027assignment\u0027\u0027 of the lease has not been finalised yet\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A document that effects this transfer\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Once you receive the \u0027\u0027assignment\u0027\u0027 in the post, be sure to sign it and send it back as soon as possible\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"An operation that assigns a value to a variable\", \"priority\":15}]}, \"synonyms\":{}}");

	add("assimilation", "{\"term\":\"assimilation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027assimilatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of assimilating or the state of being assimilated\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The metabolic conversion of nutrients into tissue\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The absorption of new ideas into an existing cognitive structure\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A sound change process by which the phonetics of a speech segment becomes more like that of another segment in a word (or at a word boundary), so that a change of phoneme occurs\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The adoption, by a minority group, of the customs and attitudes of the dominant culture\", \"priority\":5}]}, \"synonyms\":{}}");

	add("assimilationism", "{\"term\":\"assimilationism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|assimilation|ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The policy or practice of the assimilation of immigrant or other minority cultures into a mainstream culture\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027The Great Nation\u0027, Penguin 2003, p. 558\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The model of regenerative \u0027\u0027assimilationism\u0027\u0027 which the Revolutionaries displayed towards the Jews was evident in regard to other groupings whose commitment to the patriotic cause was for whatever reason in doubt\", \"priority\":3}]}, \"synonyms\":{}}");

