	add("association", "{\"term\":\"association\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From Latin {{m|la|associātiōnem}}, from {{m|la|associāre}} (perhaps via French \u0027association\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of associating\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being associated; a connection to or an affiliation with something\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003dRace volume\u003d100|issue\u003d2|page\u003d164|magazine\u003d|url\u003dhttp://www.americanscientist.org/bookshelf/pub/race-finished|passage\u003dFew concepts are as emotionally charged as that of race. The word conjures up a mixture of \u0027\u0027associations\u0027\u0027—culture, ethnicity, genetics, subjugation, exclusion and persecution. But is the tragic history of efforts to define groups of people by race really a matter of the misuse of science, the abuse of a valid biological concept\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any relationship between two measured quantities that renders them statistically dependent (but not necessarily causal or a correlation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A group of persons associated for a common purpose; an organization; society\", \"priority\":5}]}, \"synonyms\":{}}");

