	add("assonance", "{\"term\":\"assonance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French {{m|fr|assonance}}, from Latin word \u0027assonare\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The repetition of similar or identical vowel sounds (though with different consonants), usually in literature or poetry\", \"priority\":1}]}, \"synonyms\":{}}");

