	add("assumption", "{\"term\":\"assumption\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027assumpcioun\u0027 from \u0027assumptio\u0027 (a taking up (into heaven)) and Latin \u0027assumptio|lang\u003dla\u0027 () see assume.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of assuming, or taking to or upon one\u0027s self; the act of take taking up or adopting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027assumption\u0027\u0027 of secretarial duties was timely\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of taking for granted, or supposing a thing without proof; a supposition; an unwarrantable claim\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Their \u0027\u0027assumption\u0027\u0027 of his guilt disqualified them from jury duty\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The thing supposed; a postulate, or proposition assumed; a supposition\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The minor or second proposition in a categorical syllogism\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The taking of a person up into heaven\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A festival in honor of the ascent of the Virgin Mary into heaven\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Assumptio\", \"priority\":9}]}, \"synonyms\":{}}");

	add("assurance", "{\"term\":\"assurance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"Middle english (1100-1500) \u0027assuraunce\u0027 Old french (842-ca. 1400) \u0027asseürance\u0027 from \u0027asseürer\u0027 as if {{suffix|assure|ance|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of assuring; a declaration tending to inspire full confidence; that which is designed to give confidence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"xvii. 31\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Whereof he hath given \u0027\u0027assurance\u0027\u0027 unto all men, in that he hath raised him from the dead\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1800-1859\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Assurances\u0027\u0027 of support came pouring in daily\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The state of being assured; firm persuasion; full confidence or trust; freedom from doubt; certainty\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"x. 22\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Let us draw with a true heart in full \u0027\u0027assurance\u0027\u0027 of faith, having our hearts sprinkled from an evil conscience\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Firmness of mind; undoubting, steadiness; intrepidity; courage; confidence; self-reliance\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1545-1610\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Brave men meet danger with \u0027\u0027assurance\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1632-1705\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Conversation with the world will give them knowledge and \u0027\u0027assurance\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"This new-comer was a man who in any company would have seemed striking.His air, of self-confident \u0027\u0027assurance\u0027\u0027, seemed that of a man well used to having his own way\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Excess of boldness; impudence; audacity; as, his assurance is intolerable\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Betrothal; affiance\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Insurance; a contract for the payment of a sum on occasion of a certain event, as loss or death. \u0026amp;hand; Recently, assurance has been used, in England, in relation to life contingencies, and insurance in relation to other contingencies. It is called temporary assurance, in the time within which the contingent event must happen is limited\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Any written or other legal evidence of the conveyance of property; a conveyance; a deed. \u0026amp;hand; In England, the legal evidences of the conveyance of property are called the common \u0027\u0027assurances\u0027\u0027 of the kingdom. ( (1723-1780\", \"priority\":18}]}, \"synonyms\":{}}");

