	add("asswipe", "{\"term\":\"asswipe\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Bahuvrihi compound of {{compound|ass|wipe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An annoying, contemptible, or worthless person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He is such an \u0027\u0027asswipe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Timothy Jay, \u0027What to Do When Your Students Talk Dirty\u0027 page 207\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"they have been exchanging insults in writing: \u0026quot;dickhead,\u0026quot; \u0026quot;dillweed,\u0026quot; \u0026quot;fuzzbutt,\u0026quot; \u0026quot;dorkwad,\u0026quot; \u0026quot;\u0027\u0027asswipe\u0027\u0027,\u0026quot; and so forth\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"toilet Toilet paper\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027, Micheal Clodfelter, \u0027The Pawns of Dishonor\u0027,\u0026lt;sup \u0026gt;[http://books.google.com/books?id\u003dhffbAAAAIAAJ ]\u0026lt;/sup\u0026gt; Branden Press, ISBN 9780828315876, page 249\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I rapidly expended my own and everyone else’s supply of tiny w:Meal, Combat, Individual C-ration rolls of \u0027\u0027asswipe\u0027\u0027 and was reduced to wiping my nasty behind with leaves and grass\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, Nicholas Proffitt, \u0027Gardens of Stone\u0027,\u0026lt;sup \u0026gt;[http://books.google.com/books?id\u003d2FWxAAAAIAAJ ]\u0026lt;/sup\u0026gt; Carroll \u0026amp; Graf, ISBN 9780881840179, page 317\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"“ Into your packs you put your toilet articles, mess kits, extra socks, and skivvies and longjohns if you have them. If you have a roll of \u0027\u0027asswipe\u0027\u0027, put that in, too. ”\u0026lt;!-- [sic] quotation marks in original --\u0026gt\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Joseph Heywood, \u0027Death Roe: A Woods Cop Mystery\u0027,\u0026lt;sup \u0026gt;[http://books.google.com/books?id\u003dAQe3ujxs4VQC ][http://www.amazon.com/Death-Roe-Woods-Mystery-Mysteries/dp/1599214288 ]\u0026lt;/sup\u0026gt; Globe Pequot, ISBN 9781599214283, page 252\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"“I doubt a dime would buy a single square of \u0027\u0027asswipe\u0027\u0027 in this city, ” \u0026lt;!-- [sic] quotation marks in original --\u0026gt\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A periodical which has the habit of publishing questionable truths\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Our local paper is an \u0027\u0027asswipe\", \"priority\":13}]}, \"synonyms\":{}}");

